import { AuthGuard } from '@auth0/auth0-angular';
import { LandingPage } from './app/pages/landing.page';
import { VerifyPage } from './app/pages/verify.page';
import { BrandConsolePage } from './app/pages/brand-console.page';
import { CallbackPage } from './app/pages/callback.page';
export const routes = [{
  path: '',
  component: LandingPage
}, {
  path: 't/:id',
  component: VerifyPage
}, {
  path: 'brand',
  component: BrandConsolePage,
  canActivate: [AuthGuard]
}, {
  path: 'callback',
  component: CallbackPage
}, {
  path: '**',
  redirectTo: ''
}];
